  constructor(props) {
    this.login = this.login.bind(this);
  };
  login(){
    let provider = new fire.auth.GoogleAuthProvider();
    fire.auth().signInWithPopup(provider).then(result => {
      console.log(result);
    })

  }
  render(){
    return (
      <button onClick={this.login} />


